import "./App.css";
import React from "react";
import bg from "./images/bg.jpg";

function Moonproject() {
  return <div>#MoonProject</div>;
}

function App() {
  return (
    <div className="App" style={{ backgroundColor: "#000" }}>
      <img src={bg} style={{ width: "100%", height: "100%" }}></img>
    </div>
  );
}

export default App;
